import React, { Component } from 'react';
import ButtonTrend from './ButtonTrend.js'
import styles from './ButtonTrend.module.css';
import axios from 'axios';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      title:[],
      US:[{country:"io"}],
      fr:[],
      de:[],
    }
  }

  componentDidMount(){
  this.Topics();
  this.Newspaper();
  }

  async Topics() {
      const response = await fetch('/google-trend');
      const body = await response.json();
      const result = body.default.trendingSearchesDays[0].trendingSearches;
      this.setState({title:result})
  }


  async Newspaper(){
    const response = await fetch('/news-trend');
    const body = await response.json();
    this.setState({response:body});

  }

  render(props) {
    return (
      <div className="Container">

      {this.state.title.map((trend, index) =>

       <ButtonTrend key={index} title={trend.title.query}/>
     )}

      </div>
    );
  }
}

export default App;
